<!DOCTYPE html>
<html lang="zh-CN">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>文件夹样式演示</title>
    <style>
        table {
            border-collapse: collapse;
            width: 100%;
        }

        th,
        td {
            border: 1px solid #ccc;
            padding: 8px;
            position: relative;
        }

        .resizer {
            position: absolute;
            right: 0;
            top: 0;
            width: 5px;
            height: 100%;
            cursor: col-resize;
            user-select: none;
        }
    </style>
</head>

<body>

</body>
<script type="text/javascript">
    const findDuplicated = (arr) => {
        const seen = new Set()
        const res = [], err = []
        for (const item of arr) {
            const key = item.md5List.join('|')
            if (seen.has(key)) {
                err.push(item)
            } else {
                seen.add(key)
                res.push(item)
            }
        }
        return [res, err]
    }
    //arr.length < 100
    let arr = [
        {md5List: ['1234', '5678', '91043']},
        {md5List: ['5678', '1234', '91043']},
        {md5List: ['1234', '5678', '91043']},
        {md5List: ['1234', '5678']},
        {md5List: ['1234']},
        {md5List: ['1234']},
        {md5List: ['1234']},
        {md5List: ['1234']},
    ]
    console.log(  findDuplicated(arr))
</script>

</html>
